import React from 'react';

export default function Nav2({ items }) {
  return (
    <div>
      { items.map(item => {
        return (
          // <div style={{color: 'red'}}>{ item }</div>

          <div class="toc-item">
            <p class="name hidden">{ item }</p>
          </div>
        )
      }) }
    </div>
  )
};
